      releaseNotes: '* This is a maintenance update, new features coming in the next major update!\nv4.10\n- Fixed protocol issues with latest Minecraft\n- Network performance improvements\n\nv4.09\n- Fixed Xbox live names overriding in some cases\n- Fixed chat issue caused by latest Minecraft update\n\nv4.08\n- Fixed command crash\n- Fixed permissions not saving when leaving a server\n- Ban now bans the entire device not just the name/account\n- Now you can ban people after they have left the server\n- Prevent users connecting with words that are masked due to the profanity filter in Minecraft\n\nv4.07\n\u2028- Fixed commands not working from Windows when hosting Minecraft on Windows 10 through Plug, with or without xBox live logged in\u2028- Fixed plug not identifying the server owner sometimes\n\nv4.06\n\u2028- Fixed another reported issue joining servers\u2028- Fixed trade emeralds issue\u2028- Updated all items in the anti-grief search list\u2028- Updated for latest version of Minecraft\u2028- Lots of other bug fixes\n\nv4.05\u2028\n- Fixed join bug\u2028- Fixed "invisible" command\n\nv4.04\u2028\n- Fixed a connection issue\n\nv4.03\u2028\n- Updated for latest version of Minecraft\u2028- Fixed Grief protection bug in rare circumstances\u2028- Fixed reported connection bugs\u2028- Lots of other bug fixes!',
